webpackJsonp([79682921653504],{7856:function(e,t){e.exports={data:{post:{html:'<p><a href="http://creativeclass.typepad.com/thecreativityexchange/2007/04/fast_food_geogr.html"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/04/fast-food-markets-in-the-us.jpg" alt="Fast food markets in the US" /></a></p>\n<p><a href="http://sprechblase.wordpress.com/">Cem</a> sent us this link about <a href="http://creativeclass.typepad.com/thecreativityexchange/2007/04/fast_food_geogr.html">fast food markets in the US</a>. The map shows the cities with the highest and lowest number of fast food meals per capita per month. Do I detect a geographical pattern here?</p>\n<p>I wonder what the numbers for Germany would look like... not just fast-food chains, of course, but also including <em>Currywurst</em>, <em>Döner</em>, <em>Brathähnchen</em> and <em>Fischbrötchen</em>.</p>',fields:{title:"Fast Food Geography",date:"26 Apr 2007",url:"https://papascott.de/2007-04-26-fast-food-geography/"}}},pathContext:{slug:"/2007-04-26-fast-food-geography/",prev:{fields:{title:"Rock 'n' Roll High School",date:"24 Apr 2007",slug:"/2007-04-24-rock-n-roll-high-school/"}},next:{fields:{title:"American Power Conversion Kit",date:"27 Apr 2007",slug:"/2007-04-27-american-power-conversion-kit/"}}}}}});
